import React from 'react'
import {View, Text, StyleSheet, StatusBar} from 'react-native'

const Home = () => {
    return (
        // <NavigationContainer>
            <View style={styles.container}>
            <Text>This is home -- Open up App.js to start working on your app!</Text>
            <StatusBar style="auto" />
